import React from 'react'
import { makeStyles } from '@material-ui/core/styles';
import InputLabel from '@material-ui/core/InputLabel';
import MenuItem from '@material-ui/core/MenuItem';
import FormHelperText from '@material-ui/core/FormHelperText';
import FormControl from '@material-ui/core/FormControl';
import Select from '@material-ui/core/Select';
import {Grid, TextField} from "@material-ui/core";
import Autocomplete from '@material-ui/lab/Autocomplete';

const useStyles = makeStyles((theme) => ({
    root: {
        // display: 'flex',
        // flexWrap: 'nowrap'
    },

    // formControl: {
    //     margin: theme.spacing(1),
    //     width: '100%'
    // },
    selectEmpty: {
        marginTop: theme.spacing(2),
    }
}));

const TrueFalseSelectionsComponent = (props) => {
    const classes = useStyles();
    const {selectionName, selectedOption, changeOption, options } = props

    // const options = [
    //     // { title: 'Ignore', value: 0},
    //     { title: 'Enabled', value: true},
    //     { title: 'Disabled', value: false}
    // ];

    const handleChange = (event) => {
        changeOption(event.target.value);
    };


    return <div className={classes.root}>
            <Autocomplete
                options={options}
                // getOptionLabel={(option) => option.title}
                getOptionSelected={newVal => changeOption(newVal)}
                autoComplete={true}
                renderInput={(params) => <TextField {...params} label={selectionName} variant="outlined" />}
            />
    </div>
}

export default TrueFalseSelectionsComponent
